      SELECT * FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col0 * - - col1 * + 78 BETWEEN - - col1 + - col0 + + col1 * + col1 * ( - col1 ) AND col0 / + col2;
  - name: tab0

outputs:
  - name: q5651.out
    data: |
      15	81	47
      87	21	10
      97	1	99
